string::String::push.doc:
Appends the given [`char`] to the end of this `String`.

# Panics

Panics if the new capacity exceeds `isize::MAX` _bytes_.

# Examples

```
let mut s = String::from("abc");

s.push('1');
s.push('2');
s.push('3');

assert_eq!("abc123", s);
```

